    [],nt"revision_timestamp": "2016-02-29T01:19:10.781843",nt"name": "partial-pressure-or-fugacity-of-carbon-dioxide-salinity-and-other-variables-collected-from-surf4b810",nt"isopen":
    false,nt"url": null,nt"notes": "NCEI Accession 0144243 includes Surface
    underway data collected from ROGER REVELLE in the South Pacific Ocean and Southern
    Oceans (> 60 degrees South) from 2005-01-06 to 2005-02-19. These data include AIR-SEA
    DIFFERENCE - PARTIAL PRESSURE (OR FUGACITY) OF CARBON DIOXIDE, BAROMETRIC PRESSURE,
    Partial pressure (or fugacity) of carbon dioxide - atmosphere, Partial pressure
    (or fugacity) of carbon dioxide - water, SALINITY and SEA SURFACE TEMPERATURE. The
    instruments used to collect these data include Barometric pressure sensor, Carbon
    dioxide (CO2) gas analyzer, Shower head chamber equilibrator for autonomous carbon
    dioxide (CO2) measurement and thermosalinographs.nnThese data were collected by
    Richard A. Feely and Christopher Sabine of US DOC; NOAA; OAR; Pacific Marine Environmental
    Laboratory as part of the Underway Measurements during CLIVAR Section P16S_2005
    data set. CDIAC associated the following cruise ID(s) with this data set: 33RR20050106nnThe
    International CLIVAR Global Ocean Carbon and Repeat Hydrography Program carries
    out a systematic and global re-occupation of select WOCE/JGOFS hydrographic sections
    to quantify changes in storage and transport of heat, fresh water, carbon dioxide
